  }

  @override
  @optionalTypeArgs
  TResult maybeMap<TResult extends Object?>({
    TResult Function(Unexpected value)? unexpected,
    TResult Function(NoData value)? noData,
    TResult Function(FailToParseJson value)? failToParseJson,
    TResult Function(InsufficientPermissions value)? insufficientPermissions,
    TResult Function(UnableToUpdate value)? unableToUpdate,
    TResult Function(RequireIndex value)? requireIndex,
    required TResult orElse(),
  }) {
    if (requireIndex != null) {
      return requireIndex(this);
    }
    return orElse();
  }
}

abstract class RequireIndex implements FirebaseFailures {
  const factory RequireIndex() = _$RequireIndex;
}
